    UInt32 *p = (UInt32 *)[[message data] bytes];
    XCTAssertEqual(p[0], 0xDDCCBBAA, @"rpc header not correct");
    XCTAssertEqual(p[1], 0x44332211, @"rpc header not correct");
    XCTAssertEqual(p[2], 0x88776655, @"rpc header not correct");
}

